import React from 'react'
import { Link } from 'react-router-dom'
import Nav from './Nav'


function Header() {
    return (
        <>
              <Link to="/"> <img src="/images/IconYing.svg" alt="logo" style={{ width: '70px', height: 'auto' }}/></Link>
            <h1>Ying | Web Desgin &amp; Developing</h1>
        </>
    )
}

export default Header
